CREATE TABLE `project` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) COLLATE utf8_slovak_ci NOT NULL,
  `name_safe` varchar(200) COLLATE utf8_slovak_ci NOT NULL,
  `creator_id` int(11) NOT NULL,
