INSERT INTO `settings` VALUES (1,'help','<h2 style=\"text-align: center;\"><strong>Přihl&aacute;&scaron;en&iacute;</strong></h2>\n<p style=\"text-align: justify;\">&nbsp;&nbsp;</p>\n<p style=\"text-align: justify;\">Po přihl&aacute;&scaron;en&iacute; se objev&iacute; domovsk&aacute; str&aacute;nka, kde m&aacute;me stručn&yacute; přehled projektů.</p>\n<p style=\"text-align: justify;\">V&nbsp;lev&eacute; č&aacute;sti vid&iacute;me menu s&nbsp;možnostmi Homepage,,Release/Camp, Projekty,Issue, Uživatel&eacute;, Log, Nastaven&iacute;, Syst&eacute;m, &Uacute;loži&scaron;tě(vysvětlen&iacute; n&iacute;že).</p>\n<p style=\"text-align: justify;\">V&nbsp;prav&eacute;m horn&iacute;m rohu m&aacute;me uživatelsk&eacute; jm&eacute;no, po kliknut&iacute; se n&aacute;m objev&iacute; menu Můj profil,Projekty, Nahl&aacute;sit probl&eacute;m, Logy,&nbsp;Změnit jazyk a tlač&iacute;tko Odhl&aacute;sit se.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Můj profil se objev&iacute; str&aacute;nka, kde můžeme upravit n&aacute;&scaron; profil(jm&eacute;no, heslo, telefonn&iacute; č&iacute;slo). Změny se potvrd&iacute; tlač&iacute;tkem Uložit.</p>\n<p>Po kliknut&iacute; na Projekty n&aacute;m vyskoč&iacute; okno s tabulkou projektů, kter&eacute; jsem vytvořili, nebo jsme jejich souč&aacute;st&iacute;.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Logy se objev&iacute; tabulka Moje logy, kde vid&iacute;me přehled sv&yacute;ch ud&aacute;lost&iacute; jako vytv&aacute;řen&iacute;, měněn&iacute;, maz&aacute;n&iacute; včetně m&iacute;sta a data proveden&iacute;. V&nbsp;prav&eacute;m horn&iacute;m rohu nad tabulkou je modr&eacute; tlač&iacute;tko, kter&eacute; po kliknut&iacute; otevře filtr vyhled&aacute;v&aacute;n&iacute;. Ten se objevuje u v&scaron;ech tabulek pro jednodu&scaron;&scaron;&iacute; vyhled&aacute;v&aacute;n&iacute;.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na&nbsp;Nahl&aacute;sit probl&eacute;m se objev&iacute; formul&aacute;ř, kde dopln&iacute;me nadpis, popis, popř&iacute;padě dopln&iacute;me př&iacute;lohy kliknut&iacute;m na tlač&iacute;tko Zvolit soubory. V&scaron;e se potvrd&iacute; tlač&iacute;tkem Odeslat tiket.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na&nbsp;Změnit jazyk vyskoč&iacute; okno s&nbsp;v&yacute;běrem jazyka, kde si můžeme přepnout jazyk.(ENG/SK/CZ)</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>Homepage</strong></h2>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Homepage se v&aacute;m otevře &Uacute;vodn&iacute; str&aacute;nka Domov.</p>\n<p style=\"text-align: justify;\">Zde vid&iacute;me přehled sv&yacute;ch Projektů, Issues, Stav sprintů, kde můžete přep&iacute;nat jednotliv&eacute; sprinty, kde se pak podle grafu dozv&iacute;te jejich stav.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Projekt n&aacute;m vyskoč&iacute; okno s tabulkou projektů, kter&eacute; jsem vytvořili, nebo jsme jejich souč&aacute;st&iacute;.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Kalend&aacute;ř se n&aacute;m zobraz&iacute; kalend&aacute;ř.&nbsp;</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Moje &uacute;lohy se zobraz&iacute; z&aacute;ložka Issues, kde m&aacute;me vyfiltrovan&eacute; pouze Issues, kde jsem nastaven&yacute; jako ře&scaron;itel.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na n&aacute;zev Issue se n&aacute;m zobraz&iacute; dan&aacute; Issue v projektu.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na č&iacute;slo v kolonce POčet m&yacute;ch sc&eacute;n&aacute;řů se n&aacute;m otevře z&aacute;ložka Test Exekuce dan&yacute;ch sc&eacute;n&aacute;řů.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na n&aacute;zev sprintu se n&aacute;m otevře Dashboard Test Sprintu.</p>\n<h2 style=\"text-align: center;\"><strong>Release/Camp</strong></h2>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Release/Camp se v&aacute;m otevře tabulka Release/Camp.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Vytvořit kampaň n&aacute;m vyskoč&iacute; okno, zad&aacute;me n&aacute;zev a potvrd&iacute;me tlač&iacute;tkem Vytvořit.&nbsp;</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit kampaň se n&aacute;m zobraz&iacute; z&aacute;ložka na &uacute;pravu kampaně. Zde můžeme měnitn&aacute;zev kampaně nebo jednotliv&eacute; iterace a miln&iacute;ky.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me že chceme kampaň smazat.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na n&aacute;zev Kampaně se zobraz&iacute; Dashboard Kampaně.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na n&aacute;zev Test Pl&aacute;nu se zobraz&iacute; Dashboard Test Pl&aacute;nu.</p>\n<p style=\"text-align: justify;\">Kliknut&iacute;m na tlač&iacute;tko Odebrat můžeme z kampaně odebrat dan&yacute; Test Pl&aacute;n.</p>\n<h3 style=\"text-align: justify;\"><strong>Dashboard Kampaně</strong></h3>\n<p>&nbsp;</p>\n<p>Zde vid&iacute;me přehled jednotliv&yacute;ch iterac&iacute; a miln&iacute;ků, Stavy Test Exekuce a Issues v&nbsp;tabulk&aacute;ch a grafech.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Report se st&aacute;hne PDF soubor obsahuj&iacute;c&iacute; ve&scaron;ker&eacute; informace o kampani.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Přidat koment&aacute;ř, přid&aacute;me koment&aacute;ř ke kampani.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko koment&aacute;ře se n&aacute;m zobraz&iacute; historie v&scaron;ech koment&aacute;řu k dan&eacute; kampani.</p>\n<h3 style=\"text-align: justify;\"><strong>&Uacute;prava Kampaně</strong></h3>\n<p>Zde vid&iacute;me přehled jednotliv&yacute;ch iterac&iacute; a miln&iacute;ků&nbsp;&nbsp;a pr&aacute;ce s nimi.</p>\n<p>Po kliknut&iacute; na Upravit kampaň vyskoč&iacute; okno, kde můžeme změnit n&aacute;zev.</p>\n<p>Po kliknut&iacute; na Přidat miln&iacute;k vyskoč&iacute; okno, zad&aacute;me n&aacute;zev, datum, popis, důležitost a tlač&iacute;tkem Vytvořit potvrd&iacute;me.</p>\n<p>Po kliknut&iacute; na Přidat Iteraci vyskoč&iacute; okno, zad&aacute;me n&aacute;zev, popis, zač&aacute;tek a konec Iterace(mus&iacute; b&yacute;t předem vytvořen&eacute; miln&iacute;ky) a barvu grafu, tlač&iacute;tkem Vytvořit potvrd&iacute;me.</p>\n<p>Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me že chceme kampaň smazat.</p>\n<p>Po kliknut&iacute; na Upravit iterace vyskoč&iacute; okno, kde můžeme změnit n&aacute;zev, popis, miln&iacute;ky zač&aacute;tku a konce a barvu.</p>\n<p>Po kliknut&iacute; na Upravit miln&iacute;k vyskoč&iacute; okno, kde můžeme změnit n&aacute;zev, popis, datum a důležitost.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Zpět&nbsp; se n&aacute;m zobraz&iacute; tabulka Release/Camp.</p>\n<h2 style=\"text-align: center;\"><strong>Projekty&nbsp;</strong></h2>\n<p>Zde vid&iacute;me přehled jednotliv&yacute;ch projektů, můžeme zde vytvořit nov&yacute; projekt nebo si zobrazit Archiv projektů.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Vytvořit projekt vyskoč&iacute; okno, kde zad&aacute;me n&aacute;zev a popis.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Archiv se n&aacute;m zobraz&iacute; tabulka projektů, kter&eacute; jsou archivov&aacute;ny.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Otevř&iacute;t projekt se zobraz&iacute; Dashboard Projektu.</p>\n<h3 style=\"text-align: justify;\"><strong>Dashboard&nbsp;projektu</strong></h3>\n<p>Zde vid&iacute;me přehled Projektu důležit&eacute; informace o projektu, Status Test Anal&yacute;zy, Stav Test Exekuce, Projektov&eacute; probl&eacute;my.</p>\n<p>Po kliknut&iacute; na č&iacute;slo v tabulce Status test anal&yacute;zy se n&aacute;m otevře Test Anal&yacute;za s celkov&yacute;m přehledem.&nbsp;</p>\n<p>Po kliknut&iacute; na n&aacute;zev Test Pl&aacute;nu se n&aacute;m otevře&nbsp; Dashboard Test Planu.</p>\n<p>Po kliknut&iacute; na n&aacute;zev Issue se n&aacute;m zobraz&iacute; dan&aacute; Issue v projektu.</p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: justify;\"><span style=\"text-decoration: underline;\"><span style=\"color: #000000;\"><strong>Test Plan</strong></span></span></h2>\n<h3 style=\"text-align: justify;\"><strong>Legenda</strong></h3>\n<p style=\"text-align: justify;\">Test Plan = testovac&iacute; pl&aacute;n<br />Test Sprint = testovac&iacute; běh(sprint) cyklu<br />Test Execution = test exekuce <br />Test Set = sada testů<br />Test Case = testovac&iacute; sc&eacute;n&aacute;ř</p>\n<h3 style=\"text-align: justify;\"><strong>Test plan &ndash; Z&aacute;kladn&iacute; popis + možnosti akce</strong></h3>\n<p style=\"text-align: justify;\"><strong>Popis:</strong> <br />Test Plan n&aacute;m slouž&iacute; k&nbsp;vytvořen&iacute; a spr&aacute;vu jednotliv&yacute;ch běhů(sprintů) testovac&iacute;ch cyklů. <br />V&nbsp;Test Planu jde předev&scaron;&iacute;m o vytv&aacute;řen&iacute; testovac&iacute;ch pl&aacute;nů a test sprintů pro jednotliv&eacute; pl&aacute;ny Dan&yacute;m Test Pl&aacute;nům přiřad&iacute;me Test Set, kter&eacute; obsahuj&iacute; Test Casy, kter&eacute; se budou v&nbsp;jednotliv&yacute;ch Test pl&aacute;nech testovat.<br />Tak&eacute; zde přiřezujeme jednotliv&yacute;m testerům Test Casy k&nbsp;testov&aacute;n&iacute;.</p>\n<p style=\"text-align: justify;\"><strong>Možnosti:</strong><br /> Po kliknut&iacute; na z&aacute;ložku Test plan se v&aacute;m otevře nov&aacute; z&aacute;ložka Test Plan/ Test Plan Sprint. Zde m&aacute;me tabulku Test pl&aacute;nů, kde vid&iacute;me jejich ID, N&aacute;zev, Autora, Datum vytvořen&iacute; a možnosti akc&iacute; jako jsou &Uacute;prava nebo smaz&aacute;n&iacute;.<br />V&nbsp;prav&eacute;m horn&iacute;m rohu nad tabulkou jsou 4 tlač&iacute;tka: Vytvořit nov&yacute; Test Plan, Vytvořit nov&yacute; Test Sprint, Filtr vyhled&aacute;van&iacute;, Možnosti zobrazen&iacute; tabulky.<br />Pokud m&aacute;me vytvořen&yacute; nějak&yacute; Test plan nebo Test Sprint je možnost se na ně pod&iacute;vat kliknut&iacute;m na jejich n&aacute;zev v&nbsp;tabulce.</p>\n<h3 style=\"text-align: justify;\"><strong>Vytvořen&iacute; nov&eacute;ho Test&nbsp;Pl&aacute;nu</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Vytvořit nov&yacute; Test plan se n&aacute;m otevře nov&aacute; z&aacute;ložka. Zde zad&aacute;me n&aacute;zev Test planu a tak&eacute; zde m&aacute;me tabulku kter&aacute; obsahuje Testovac&iacute; Sc&eacute;n&aacute;ře. Z&nbsp;tabulky vybereme Testovac&iacute; Sc&eacute;n&aacute;ř/e, kter&yacute; se maj&iacute; v&nbsp;dan&eacute;m Test planu testovat. (Pokud nem&aacute;me vytvořen&eacute; ž&aacute;dn&eacute; Testovac&iacute; Sc&eacute;n&aacute;ře tabulka bude pr&aacute;zdn&aacute;.) Klikneme na tlač&iacute;tko Přidat a t&iacute;m se n&aacute;m vytvoř&iacute; Test pl&aacute;n.</p>\n<h3 style=\"text-align: justify;\"><strong>Dashboard Test pl&aacute;nu</strong></h3>\n<p><strong>Dashboard:</strong></p>\n<p>Po kliknut&iacute; na n&aacute;zev Test Pl&aacute;nu se otevře Dashboard Test pl&aacute;nu.&nbsp;</p>\n<p>Zde vid&iacute;me informace o dan&eacute;m Test pl&aacute;nu v tabulk&aacute;ch a grafech.</p>\n<p>Můžeme zde přep&iacute;nam mezi jednotliv&yacute;mi Test Pl&aacute;ny, pomoc&iacute; tlač&iacute;tka Změň.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Report se st&aacute;hne PDF soubor obsahuj&iacute;c&iacute; ve&scaron;ker&eacute; informace o Test pl&aacute;nu včetně grafů.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Přidat koment&aacute;ř přid&aacute;me koment&aacute;ř k dan&eacute;mu Test pl&aacute;nu.</p>\n<p>Po kliknut&iacute; na Koment&aacute;ře se n&aacute;m zobraz&iacute; historie v&scaron;ech koment&aacute;řu k Test pl&aacute;nu.</p>\n<p>Po kliknut&iacute; na Zpět se n&aacute;m zobraz&iacute; tabulka Test Pl&aacute;nu.</p>\n<p><strong>Seznam test sprintů:</strong></p>\n<p>Po kliknut&iacute; na Seznam test sprintů se zobraz&iacute; tabulka Test sprintů&nbsp; v Test pl&aacute;nu.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Vytvořit nov&yacute; Test sprint se otevře z&aacute;ložka na Vytvořen&iacute; test sprintu.</p>\n<p>Po kliknut&iacute; na n&aacute;zev Test sprintu nebo tlač&iacute;tko Zobrazit se n&aacute;m otevře Dashboard Test Sprintu.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Upravit se otevře z&aacute;ložka, kde můžeme upravit Test Sprint.&nbsp;</p>\n<p>Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me smaz&aacute;n&iacute; Test Sprintu.</p>\n<p><strong>Upravit Test pl&aacute;n:</strong></p>\n<p>Po kliknut&iacute; na Upravit Test pl&aacute;n se otevře z&aacute;ložka, kde můžeme změnit n&aacute;zev Test pl&aacute;nu, nebo jednotliv&eacute; testovac&iacute; sc&eacute;n&aacute;ře co se budou testovat v dan&eacute;m Test pl&aacute;nu.&nbsp;</p>\n<p><strong>Zařadit do kampaně:&nbsp;</strong></p>\n<p>Po kliknut&iacute; na Zařadit do Kampaně se otevře z&aacute;ložka, kde můžu zvolit do jak&eacute; kampaně se Test pl&aacute;n m&aacute; zařadit.</p>\n<p>&nbsp;</p>\n<h3 style=\"text-align: justify;\"><strong>Vytvořen&iacute; nov&eacute;ho Test Sprintu</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Vytvořit nov&yacute; Test Sprint se n&aacute;m otevře nov&aacute; z&aacute;ložka. Zde m&aacute;me 4 kolonky na vyplněn&iacute;: N&aacute;zev Test sprintu, V&yacute;běr Test planu, Zač&aacute;tek a Konec. Aby &scaron;el vytvořit nov&yacute; Test sprint je zapotřeb&iacute; m&iacute;t vytvořen&yacute; alespoň jeden Test plan. (Pokud nevyberete Test plan vyskoč&iacute; v&aacute;m chybov&aacute; hl&aacute;&scaron;ka.) Zad&aacute;me n&aacute;zev Test sprintu, vybereme Test plan, do kter&eacute;ho bude patřit dan&yacute; Test sprint. Nakonec zvol&iacute;me datum zač&aacute;tku a konec Test sprintu. Klikneme na Přidat, t&iacute;m se n&aacute;m vytvoř&iacute; nov&yacute; Test sprint a otevře se nov&aacute; z&aacute;ložka Dashboard Test Sprintu.</p>\n<h3 style=\"text-align: justify;\"><strong>Dashboard Test Sprint</strong></h3>\n<p style=\"text-align: justify;\"><strong>M&aacute;me dvě možnosti na otevřen&iacute; Dashboardu Test Sprintu:</strong></p>\n<p style=\"text-align: justify;\">Vytvořen&iacute;m nov&eacute;ho Test sprintu <br />Kliknut&iacute;m na n&aacute;zev Test sprintu v&nbsp;tabulce &uacute;vodn&iacute; tabulce Test planu</p>\n<h3 style=\"text-align: justify;\"><strong>Dashboard Test Sprintu</strong></h3>\n<h4 style=\"text-align: justify;\"><strong>Dashboard</strong></h4>\n<p>Zde vid&iacute;me informace o dan&eacute;m Test sprintu v tabulk&aacute;ch.</p>\n<p>Můžeme zde přep&iacute;nam mezi jednotliv&yacute;mi Test sprinty, pomoc&iacute; tlač&iacute;tka Změň.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Report se st&aacute;hne PDF soubor obsahuj&iacute;c&iacute; ve&scaron;ker&eacute; informace o Test sprintu.</p>\n<p>Po kliknut&iacute; na tlač&iacute;tko Přidat koment&aacute;ř přid&aacute;me koment&aacute;ř k dan&eacute;mu Test sprintu.</p>\n<p>Po kliknut&iacute; na Koment&aacute;ře se n&aacute;m zobraz&iacute; historie v&scaron;ech koment&aacute;řu k Test sprintu.</p>\n<p>Po kliknut&iacute; na Zpět se n&aacute;m zobraz&iacute; Dashboard Test Pl&aacute;nu.</p>\n<h4 style=\"text-align: justify;\"><strong>Upravit Test sprint</strong></h4>\n<p>Po kliknut&iacute; na Upravit Test sprint se otevře z&aacute;ložka, kde můžeme změnit n&aacute;zev, datumy zač&aacute;tku a konce Test sprintu, nebo jednotliv&eacute; testovac&iacute; sc&eacute;n&aacute;ře co se budou testovat v dan&eacute;m Test sprintu.&nbsp;</p>\n<p style=\"text-align: justify;\"><strong>Upravit Tagy</strong></p>\n<p style=\"text-align: justify;\">Otevře se n&aacute;m z&aacute;ložka spr&aacute;va tagů, zde vid&iacute;me tabulku v&scaron;ech tagů v&nbsp;dan&eacute;m Test sprintu. Obsahuje n&aacute;zev tagu, datum od a datum do. Můžeme zde změnit obě data a kliknut&iacute;m na tlač&iacute;tko Uložit, se projev&iacute; změny.</p>\n<h4 style=\"text-align: justify;\"><strong>Přiřadit testovac&iacute; sc&eacute;n&aacute;ř</strong></h4>\n<p style=\"text-align: justify;\">Otevře se n&aacute;m z&aacute;ložka Přiřadit testovac&iacute; sc&eacute;n&aacute;ř, zde vid&iacute;me tabulku, kter&aacute; obsahuje testery. (Pokud nejsou testeři k&nbsp;projektu přiřazeni tabulka bude pr&aacute;zdn&aacute;.) Kliknut&iacute;m na tlač&iacute;tko Přiřadit testovac&iacute; sc&eacute;n&aacute;řt v&nbsp;prav&eacute; č&aacute;sti se n&aacute;m zobraz&iacute; z&aacute;ložka, kde vid&iacute;me seznam Testovac&iacute;ch sc&eacute;n&aacute;řů. Zde můžeme dan&eacute;mu testerovi přiřadit, jak&eacute; testovac&iacute; sc&eacute;n&aacute;ře m&aacute; testovat. Kliknut&iacute;m na tlač&iacute;tko Uložit se projev&iacute; změny a testerovi se přiřad&iacute; dan&eacute; Testovac&iacute; sc&eacute;n&aacute;ře.<br /><br /></p>\n<h3 style=\"text-align: justify;\">&nbsp;<strong>Upravit Test Plan</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Upravit Test Plan v&nbsp;prav&eacute; č&aacute;sti &uacute;vodn&iacute; tabulky Test Planu se n&aacute;m otevře z&aacute;ložka. Zde můžeme změnit n&aacute;zev jeho přeps&aacute;n&iacute;m, nebo upravit seznam Testovac&iacute;ch sc&eacute;n&aacute;řů, kter&eacute; se maj&iacute; testovat v&nbsp;dan&eacute;m Test planu. Kliknut&iacute;m na tlač&iacute;tko Uložit se projev&iacute; změny. A vr&aacute;t&iacute; n&aacute;s to na &uacute;vodn&iacute; tabulku Test Planu.</p>\n<h3 style=\"text-align: justify;\"><strong>Smazat Test Plan/Sprint</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Smazat v&nbsp;prav&eacute; č&aacute;sti &uacute;vodn&iacute; tabulky Test Planu n&aacute;m vyskoč&iacute; okno Smazat, kter&eacute; se n&aacute;s pt&aacute;, jestli chceme Test Plan/Sprint opravdu smazat. <br />M&aacute;me zde dvě tlač&iacute;tka:<br />Zpět-Vr&aacute;t&iacute; n&aacute;s na &uacute;vodn&iacute; tabulku Test Planu.<br />Smazat-Smaže Test Plan/Sprint</p>\n<h3 style=\"text-align: justify;\"><strong>Filtr</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko filtr n&aacute;m vyskoč&iacute; okno filtru, kter&eacute; obsahuje 4 kolonky: N&aacute;zev TP, Autor TP, rozmez&iacute; datumu vytvořen&iacute;. <br />Po jeho vyplněn&iacute; se n&aacute;m aktualizuje seznam Test Planu/Sprintu. Po vyplněn&iacute; nějak&eacute; kolonky se n&aacute;m zobraz&iacute; tlač&iacute;tko na resetovan&iacute; filtru, kter&eacute; resetuje cel&yacute; filtr.</p>\n<h3 style=\"text-align: justify;\"><strong>Tlač&iacute;tko Možnosti zobrazen&iacute; tabulky</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko n&aacute;m vyskoč&iacute; okno, ve kter&eacute;m můžeme zvolit/zru&scaron;it zobrazen&iacute; někter&eacute; informace tabulky (ID, N&aacute;zev, Autor, Datum vytvořen&iacute;, Akce). Nebo můžeme zvolit zobrazen&iacute; v&scaron;ech sloupců.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h2 style=\"text-align: justify;\"><span style=\"text-decoration: underline;\"><strong>Test Analyses</strong></span></h2>\n<h3 style=\"text-align: justify;\"><strong>Legenda</strong></h3>\n<p style=\"text-align: justify;\">Test Set = sada testů<br />Test Case = testovac&iacute; sc&eacute;n&aacute;ř<br />Bulk Test Case = skupina testů<br />Import = Nahr&aacute;t</p>\n<h3 style=\"text-align: justify;\"><strong>Test analyses &ndash; Z&aacute;kladn&iacute; popis + možnosti akce</strong></h3>\n<h4 style=\"text-align: justify;\"><strong>Popis:</strong></h4>\n<p style=\"text-align: justify;\">Test anal&yacute;za n&aacute;m slouž&iacute; k&nbsp;vytvořen&iacute; Testovac&iacute;ch sad, kter&eacute; obsahuj&iacute; testovac&iacute; sc&eacute;n&aacute;ře.<br />V&nbsp;Test anal&yacute;ze, lze předev&scaron;&iacute;m o vytvořen&iacute; konkr&eacute;tn&iacute;ch postupů dan&yacute;ch testů, kter&eacute; se později spou&scaron;t&iacute; v&nbsp;Test Exekuci a z&nbsp;t&eacute; dostaneme konkr&eacute;tn&iacute; v&yacute;sledky, jak dan&yacute; test proběhl.<br />Ty se potom přiřazuj&iacute; konkr&eacute;tn&iacute;m Testovac&iacute;m pl&aacute;nům, kter&eacute; se přiřazuj&iacute; testerům.</p>\n<h4 style=\"text-align: justify;\"><strong>Možnosti:</strong></h4>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na z&aacute;ložku Test analyses se v&aacute;m otevře nov&aacute; z&aacute;ložka Test analyses. Zde m&aacute;me tabulku Test Set/Casu, kde vid&iacute;me jejich ID, N&aacute;zev, Autora, Schv&aacute;len&iacute;, Datum vytvořen&iacute; a možnosti akc&iacute; jako jsou Přid&aacute;n&iacute;, &Uacute;prava, Klonov&aacute;n&iacute;, Schv&aacute;len&iacute; nebo Smaz&aacute;n&iacute;.<br />V&nbsp;prav&eacute;m horn&iacute;m rohu nad tabulkou je 7 tlač&iacute;tek: Vytvořit Test Set, Přidat Test Case, Přidat Bulk Test Case, Import, Export, Filtr vyhled&aacute;van&iacute;, Možnosti zobrazen&iacute; tabulky.<br />Pokud m&aacute;me vytvořen&yacute; nějak&yacute; Test Case je možnost se na něj pod&iacute;vat kliknut&iacute;m na jeho n&aacute;zev v&nbsp;tabulce.</p>\n<h3 style=\"text-align: justify;\"><strong>Vytvořen&iacute; nov&eacute;ho Test Setu</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Vytvořit nov&yacute; Test Set n&aacute;m vyskoč&iacute; okno Vytvořit nov&yacute; Test Set. Zde zad&aacute;me n&aacute;zev Test Setu a Tagy a Popis projektu. Klikneme na tlač&iacute;tko Přidat a t&iacute;m se n&aacute;m vytvoř&iacute; Test Set.</p>\n<h3 style=\"text-align: justify;\"><strong>Přid&aacute;n&iacute; nov&eacute;ho Test Casu</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Přidat Test Case (Tlač&iacute;tko Nad tabulkou, nebo + v tabulce) n&aacute;m vyskoč&iacute; okno Přidat Test Case. Zde m&aacute;me několik kolonek na vyplněn&iacute;: V&yacute;běr Test Setu (Test Set, do kter&eacute;ho přid&aacute;v&aacute;me Test Case), N&aacute;zev Test Casu, Tagy, Popis, V&yacute;sledek, Priorita,Seznam aplikac&iacute;, Prostřed&iacute;, Modul, Schv&aacute;len&eacute;, Př&iacute;lohy a Test Stepy (Jednotliv&eacute; kroky dan&eacute;ho Test Casu), kter&eacute; jsou rozděleny na dvě č&aacute;sti: Předpoklad a Oček&aacute;van&yacute; v&yacute;sledek. Aby &scaron;el vytvořit nov&yacute; Test Case je zapotřeb&iacute; m&iacute;t vytvořen&yacute; alespoň jeden Test Set. (Pokud nevyberete Test Set vyskoč&iacute; v&aacute;m chybov&aacute; hl&aacute;&scaron;ka.) Vybereme Test Set, do kter&eacute;ho bude Test Case přidan&yacute;.<br /> Zad&aacute;me n&aacute;zev Test Casu, zad&aacute;me tagy, popis, v&yacute;sledek, zvol&iacute;m prioritu dan&eacute;ho Test Casu, vybereme, jestli bude dan&yacute; Test Case schv&aacute;len&yacute;, přid&aacute;me př&iacute;lohy (nen&iacute; nutn&eacute;) a nakonec zad&aacute;me jednotliv&eacute; kroky dan&eacute;ho Test Casu. Po kliknut&iacute; na tlač&iacute;tko Přidat se n&aacute;m vytvoř&iacute; Test Case a zobraz&iacute; se n&aacute;m v&nbsp;&uacute;vodn&iacute; tabulce.</p>\n<p style=\"text-align: justify;\">&nbsp;<strong>Zobrazen&iacute; Test Casu</strong></p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na jm&eacute;no Test Casu n&aacute;m vyskoč&iacute; okno, ve kter&eacute;m vid&iacute;me v&scaron;echny hodnoty, kter&eacute; dan&yacute; Test Case obsahuje. A nav&iacute;c zde vid&iacute;me, kdo dan&yacute; Test Case vytvořil a datum, kdy byl vytvořen. Po kliknut&iacute; na tlač&iacute;tko Zavř&iacute;t se n&aacute;m zobraz&iacute; &uacute;vodn&iacute; tabulka.</p>\n<h3 style=\"text-align: justify;\"><strong>Přid&aacute;n&iacute; Bulk Test Case</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Přidat Bulk Test Case n&aacute;m vyskoč&iacute; okno Přidat Bulk Test Case. Zde m&aacute;me několik kolonek na vyplněn&iacute;. V&yacute;běr Test Setu (Test Set, do kter&eacute;ho přid&aacute;v&aacute;me Bulk Test Case), tuto kolonku můžeme změnit kliknut&iacute;m na Vytvořit nov&yacute; Test Set. Tato funkce n&aacute;m přepne V&yacute;běr Test Setu na Zad&aacute;n&iacute; n&aacute;zvu nov&eacute;ho Test Setu a kolonka Test Case, zde zad&aacute;me n&aacute;zvy nov&yacute;ch Test Casu. <br />Vybereme Test Set, do kter&eacute;ho bude Bulk Test Case přidan&yacute; (Nebo zad&aacute;me n&aacute;zev nov&eacute;ho Test Setu) a zad&aacute;me n&aacute;zvy nov&yacute;ch Test Casu. Kliknut&iacute;m na tlač&iacute;tko Přidat se buď přidaj&iacute; Test Casy do již vytvořen&eacute;ho Test Setu, nebo se vytvoř&iacute; nov&yacute; Test Set a do něho se přidaj&iacute; nov&eacute; Test Casy. A vr&aacute;t&iacute; n&aacute;s to na &uacute;vodn&iacute; tabulku.</p>\n<h3 style=\"text-align: justify;\"><strong>Import</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Import n&aacute;m vyskoč&iacute; okno Import, zde můžeme vybrat (Excel.xlsx) soubor (Importn&iacute; &scaron;ablona). Po kliknut&iacute; na Přidat se n&aacute;m do projektu přidaj&iacute; již vyplněn&eacute; Test Sety a Test Casy z&nbsp;dan&eacute; &scaron;ablony.</p>\n<h3 style=\"text-align: justify;\"><strong>Export</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Export se n&aacute;m st&aacute;hne soubor(Excel) podobn&yacute; Importn&iacute; &scaron;abloně, kter&yacute; po nahran&iacute; vytvoř&iacute; stejn&eacute; Test Sety a Test Casy, kter&eacute; byly v&nbsp;exportovan&eacute; Test Anal&yacute;ze.</p>\n<h3 style=\"text-align: justify;\"><strong>Označit v&scaron;echny Test Casy jako schv&aacute;len&eacute;</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Označit v&scaron;echny Test Casy jako schv&aacute;len&eacute; v&nbsp;prav&eacute; č&aacute;sti &uacute;vodn&iacute; tabulky se n&aacute;m změn&iacute; schv&aacute;len&iacute; v&scaron;ech Test Casu, takže celkov&eacute; schv&aacute;len&iacute; Test Setu na schv&aacute;len&eacute;.</p>\n<h3 style=\"text-align: justify;\"><strong>Upravit Test Set</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Upravit Test Set v&nbsp;prav&eacute; č&aacute;sti &uacute;vodn&iacute; tabulky Test Setu/Casu n&aacute;m vyskoč&iacute; okno Upravit Test Set. <br />Zde můžeme změnit n&aacute;zev a popis jeho přeps&aacute;n&iacute;m, nebo upravit seznam Tagů (Přidat nebo Odebrat), v&nbsp;dan&eacute;ho Test Setu. Kliknut&iacute;m na tlač&iacute;tko Uložit se projev&iacute; změny. A vr&aacute;t&iacute; n&aacute;s to na &uacute;vodn&iacute; tabulku Test Setu/Casu.</p>\n<h3 style=\"text-align: justify;\"><strong>Klonovat Test Case</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Klonovat Test Case v&nbsp;prav&eacute; č&aacute;sti &uacute;vodn&iacute; tabulky Test Setu/Casu n&aacute;m vyskoč&iacute; okno na Vytvořen&iacute; nov&eacute;ho Test Casu. <br />Změn&iacute;me n&aacute;zev Test Casu, uprav&iacute;me potřebn&eacute; změny v&nbsp;někter&eacute; z&nbsp;kolonek: Tagy, Popis, V&yacute;sledek, Priorita, vybereme, jestli bude dan&yacute; Test Case schv&aacute;len&yacute;, Př&iacute;lohy a Test Stepy (Nemus&iacute;me měnit v&scaron;e, pouze věci, ve kter&yacute;ch se bude nov&yacute; Test Case li&scaron;it od původn&iacute;ho klonovan&eacute;ho.) Po kliknut&iacute; na tlač&iacute;tko Přidat se n&aacute;m vytvoř&iacute; nov&yacute; Test Case a zobraz&iacute; se n&aacute;m v&nbsp;&uacute;vodn&iacute; tabulce.</p>\n<h3 style=\"text-align: justify;\"><strong>Upravit Test Case</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Upravit Test Case v&nbsp;prav&eacute; č&aacute;sti &uacute;vodn&iacute; tabulky Test Setu/Casu n&aacute;m vyskoč&iacute; okno Upravit Test Case. <br />Zde můžeme změnit Test Set, do kter&eacute;ho bude patřit dan&yacute; Test Case, n&aacute;zev Test Casu, Tagy, Popis, V&yacute;sledek, Prioritu, Schv&aacute;len&iacute;, Př&iacute;lohy a jednotliv&eacute; Test Stepy. Kliknut&iacute;m na tlač&iacute;tko Uložit se projev&iacute; změny. A vr&aacute;t&iacute; n&aacute;s to na &uacute;vodn&iacute; tabulku Test Setu/Casu.</p>\n<h3 style=\"text-align: justify;\"><strong>Smazat Test Set/Case</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko Smazat v&nbsp;prav&eacute; č&aacute;sti &uacute;vodn&iacute; tabulky Test Setu/Casu n&aacute;m vyskoč&iacute; okno Smazat, kter&eacute; se n&aacute;s pt&aacute;, jestli chceme Test Set/Case opravdu smazat. <br />M&aacute;me zde dvě tlač&iacute;tka:<br />Zpět-Vr&aacute;t&iacute; n&aacute;s na &uacute;vodn&iacute; tabulku Test Setu/Casu.<br />Smazat-Smaže Test Set/Case</p>\n<h3 style=\"text-align: justify;\"><strong>Filtr</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko filtr n&aacute;m vyskoč&iacute; okno filtru, kter&eacute; obsahuje 4 kolonky: N&aacute;zev Test Setu, Autor Test Setu, rozmez&iacute; datumu vytvořen&iacute; Test Setu. <br />Po jeho vyplněn&iacute; se n&aacute;m aktualizuje seznam Test Setu/Casu. Po vyplněn&iacute; nějak&eacute; kolonky se n&aacute;m zobraz&iacute; tlač&iacute;tko na resetovan&iacute; filtru, kter&eacute; resetuje cel&yacute; filtr.</p>\n<h3 style=\"text-align: justify;\"><strong>Tlač&iacute;tko Možnosti zobrazen&iacute; tabulky</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na tlač&iacute;tko n&aacute;m vyskoč&iacute; okno, ve kter&eacute;m můžeme zvolit/zru&scaron;it zobrazen&iacute; někter&eacute; informace tabulky (ID, N&aacute;zev, Autor, Schv&aacute;len&eacute;, Datum vytvořen&iacute;, Akce). Nebo můžeme zvolit zobrazen&iacute; v&scaron;ech sloupců.</p>\n<h2><span style=\"text-decoration: underline;\"><strong>Test Execution</strong></span></h2>\n<h3><strong>Z&aacute;kladn&iacute; popis a akce</strong></h3>\n<p>Po kliknut&iacute; na z&aacute;ložku Test Execution se v&aacute;m otevře str&aacute;nka, kde jsou dva pr&aacute;zdn&eacute; ř&aacute;dky a jedno tlač&iacute;tko s n&aacute;pisem Vybrat .Pokud jsou vytvořeny jak Test Plany tak Test Sprinty můžete kliknut&iacute;m na pr&aacute;zdn&yacute; ř&aacute;dek nějak&yacute; vybrat a kliknout na tlač&iacute;tko Vybrat. Pokud ale nic z toho vytvořen&eacute; nen&iacute; mus&iacute;te si je nejdř&iacute;ve vytvořit. (N&aacute;vod na vytvořen&iacute; je v&yacute;&scaron;e....)Po kliknut&iacute; na tlač&iacute;tko Vybrat se otevře nov&aacute; str&aacute;nka, kde je seznam různ&yacute;ch sc&eacute;n&aacute;řů k testov&aacute;n&iacute;. Sc&eacute;n&aacute;ře, kter&eacute; j&iacute;ž byly testovan&eacute; jsou označen&eacute; buď zelenou, červenou nebo žlutou barvou.V seznamu m&aacute;te vyps&aacute;ny n&aacute;sleduj&iacute;c&iacute; &uacute;daje. ID sc&eacute;n&aacute;ře, n&aacute;zev Test Setu, n&aacute;zev Test Casu, počet Test Stepů v Test Casu, počet otestovan&yacute;ch Test Stepů, Status po proveden&iacute;, priorita proveden&iacute; sc&eacute;n&aacute;ře a posledn&iacute; je tlač&iacute;tko Otevř&iacute;t nebo-li akce .</p>\n<h3><strong>Proveden&iacute;&nbsp;Exekuce</strong></h3>\n<p>Pokud kliknete na tlač&iacute;tko Otevř&iacute;t, otevře se ok&eacute;nko pro testovan&iacute; dan&eacute;ho sc&eacute;n&aacute;ře.</p>\n<p>Zde jsou vidět podobn&eacute; informace jako v seznamu sc&eacute;n&aacute;řů nav&iacute;c jsou zde podrobn&eacute; o Test Stepech jako je jejich ID, předpoklad proveden&iacute; a oček&aacute;van&yacute; v&yacute;sledek. Vpravo v rohu si můžeme pov&scaron;imnout 3 akc&iacute;. 1. akc&iacute; je časovač ten se po stisknut&iacute; tlač&iacute;tka play spust&iacute;. 2. akc&iacute; je Priorita, zde je vidět jak důležit&eacute; je proveden&iacute; n&aacute;sleduj&iacute;c&iacute;ho sc&eacute;n&aacute;ře.</p>\n<p>Akce je status, kter&yacute; dok&aacute;že nastavit v&scaron;em Test Stepům najednou přiřadit stejnou hodnotu. Tak&eacute; si můžeme pov&scaron;imnout, že status je u jednotliv&yacute;ch Test Stepů &scaron;ediv&yacute;. To proto, že před nastavov&aacute;n&iacute; statusu u jednotliv&yacute;ch Test Stepů se mus&iacute; spustit časovač. Po spu&scaron;těn&iacute; časovače se tlač&iacute;tka zv&yacute;razn&iacute; a vy na ně můžete kliknout. Když na ně kliknete zobraz&iacute; se 5 možnost&iacute; : Passed, Failed, No Run, N/A a Not Completed. U každ&eacute;ho Test stepu můžete zvolit v&yacute;sledek, kter&yacute; se prop&iacute;&scaron;e do tabulky Historie Test Stepu.&nbsp;<br />Pokud zvol&iacute;te možnost Passed, cel&yacute; řadek dostane zelenou barvu a vy můžete přejit k dal&scaron;&iacute;mu kroku. Když zvol&iacute;te Failed, cel&yacute; ř&aacute;dek zčerven&aacute; a pod tlač&iacute;tkem, kde je naps&aacute;no Failed se objev&iacute; slovo Issue na, kter&eacute; vy mus&iacute;te kliknout a vytvořit způsobem,kter&yacute; je pops&aacute;n v kapitole Issues jelikož dan&yacute; Test Step se nepovedl splnit. To sam&eacute; se děje i u hl&aacute;&scaron;ek N/A a Not Completed, akor&aacute;t že m&iacute;sto červen&eacute; je ř&aacute;dek žlut&yacute;. Po splněn&iacute; v&scaron;ech Test Stepu vypnete časovač a kliknete na tlač&iacute;tko Zavř&iacute;t.</p>\n<h3><strong>Historie při prov&aacute;děn&iacute; Test Execution</strong></h3>\n<p>Po proveden&iacute; jednotliv&eacute;ho kroku a označen&iacute; kroku odpov&iacute;daj&iacute;c&iacute;m statusem se pod touto kolonkou vedle n&aacute;pisu issue zobraz&iacute; n&aacute;pis Historie. Po kliknut&iacute; na tento n&aacute;pis se zobraz&iacute; ok&eacute;nko, kde je možno vidět kdo prov&aacute;děl danou exekuci, kdy byla provedena a jak&yacute;m v&yacute;sledkem skončila. Tak&eacute; je zde vidět historie issue, kter&eacute; byly vytvořeny. U nich je možno vidět, kdo je vytvořil jak&eacute; maj&iacute; ID a kdy byly vytvořeny. a je zde vidět v&yacute;sledek Test Stepu a př&iacute;padně přidan&eacute; př&iacute;lohy.</p>\n<h3><strong>Vyhled&aacute;v&aacute;n&iacute; konkr&eacute;tn&iacute; Execution</strong></h3>\n<p>Pokud je na str&aacute;nce hodně sc&eacute;n&aacute;řů a vy hled&aacute;te jeden konkr&eacute;tn&iacute; mohl by v&aacute;m pomoci filtr. Ten se objev&iacute; kliknut&iacute;m na modr&eacute; tlač&iacute;tko, kter&eacute; se nach&aacute;z&iacute; vpravo nad sloupcem s akc&iacute;. Zde m&aacute;te na v&yacute;běr ze 4 možnost. Buď můžete hledat pomoc&iacute; n&aacute;zvu Test Setu, n&aacute;zvu Test Casu, Priority a nebo Statusu, kter&yacute; m&aacute; požadovan&yacute; sc&eacute;n&aacute;ř.</p>\n<h2 style=\"text-align: justify;\"><span style=\"text-decoration: underline;\"><strong>Issues</strong></span></h2>\n<h3 style=\"text-align: justify;\"><strong>Issue- Z&aacute;kladn&iacute; popis a akce</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na z&aacute;ložku Issues se zobraz&iacute; str&aacute;nka, kde je možno vidět seznam již vytvořen&yacute;ch Issues. Je zde vidět jejich ID, n&aacute;zev Test Stepu, Sprintu a Casu pro kter&eacute; byla Issue vytvořena, n&aacute;zev Issue, popis dan&eacute; Issue, kdo m&aacute; Issue ře&scaron;it, typ Issue (jestli je to bug, defect nebo request), jej&iacute; prioritu, status a datum vytvořen&iacute; Issue.Vpravo vedle data vytvořen&iacute; jsou viděl jednotliv&eacute; akce. Je zde Zobrazit Issue, Editovat Issue a Smazat Issue. Nad těmito akcemi jsou vidět dal&scaron;&iacute; 4 tlač&iacute;tka. Když kliknete na mal&eacute; modr&eacute; tlač&iacute;tko , tak se v&aacute;m zobraz&iacute; filtr, kter&yacute; v&aacute;m usnadn&iacute; pr&aacute;ci při vyhled&aacute;v&aacute;n&iacute; konkr&eacute;tn&iacute; Issue. Pokud kliknete vedle na mal&eacute; b&iacute;le tlač&iacute;tko, zobraz&iacute; seznam věc&iacute;, kter&eacute; chcete v seznamu u Issue vidět. Tento seznam si můžete jakkoliv editovat např. v seznamu bude vidět jen n&aacute;zev Issues, jejich priorita a ře&scaron;itel.</p>\n<h3 style=\"text-align: justify;\"><strong>Založen&iacute; nov&eacute; Issue</strong></h3>\n<p style=\"text-align: justify;\">Je to možn&eacute; dvěma způsoby. 1. způsob už byl zm&iacute;něn u Test Execution. Takže zde bude pops&aacute;n ten druh&yacute;. Prvn&iacute;m krokem je kliknut&iacute; na tlač&iacute;tko Založit Issue, kde se pot&eacute; zobraz&iacute; str&aacute;nka s voln&yacute;mi kolonkami, kter&eacute; mus&iacute; b&yacute;t vyplněny.Mus&iacute;te zde zadat vybrat Test Plan, Sprint, Set, Case a Step u kter&eacute;ho chyba nastala, zvolit Prioritu, kter&aacute; může nab&yacute;vat hodnot: Low, Medium a High, Typ dan&eacute; chyby, kter&yacute; může b&yacute;t buď Bug, Defect a nebo Request. Pot&eacute; stručně napsat n&aacute;zev chyby a pod to podrobněj&scaron;&iacute; popis probl&eacute;mu. Tak&eacute; zde můžete přidat přilohu jako např. obr&aacute;zek co přesně se stalo, když nastala chyba. A vyplnit Seznam aplikac&iacute;, Prostřed&iacute;, Modul pokud je třeba. V posledn&iacute; řadě mus&iacute;te zvolit kdo by dan&yacute; probl&eacute;m měl vyře&scaron;it .&nbsp;</p>\n<h3 style=\"text-align: justify;\"><strong>Export Issues</strong></h3>\n<p style=\"text-align: justify;\">Kliknut&iacute;m na tlač&iacute;tko Export se do va&scaron;eho poč&iacute;tače st&aacute;hne soubor s př&iacute;ponou .csv. Tu když otevřete tak zde bude tabulka Issues kter&eacute; jsou i na port&aacute;le se v&scaron;emi informacemi o Issues.</p>\n<h3 style=\"text-align: justify;\"><strong>Zobrazit Issue</strong></h3>\n<p style=\"text-align: justify;\">Když kliknete na tlač&iacute;tko Zobrazit Issue, zobraz&iacute; se str&aacute;nka, kde můžete vidět ve&scaron;ker&eacute; informaci o probl&eacute;mu, kter&yacute; nastal. Nemůžete tyto informace nijak upravit ale můžete k dan&eacute;mu probl&eacute;mu vložit koment&aacute;ř.</p>\n<p style=\"text-align: justify;\">Ten se vkl&aacute;d&aacute; dole na str&aacute;nce.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit vyskoč&iacute; okno, kde můžeme Upravit Issue.</p>\n<h3 style=\"text-align: justify;\"><strong>Upravit Issue</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na žlut&eacute; tlač&iacute;tko vpravo od tlač&iacute;tka Zobrazit Issue se zobraz&iacute; podobn&aacute; str&aacute;nka jako při kliknut&iacute; na tlač&iacute;tko Zobrazit Issue. Jedin&eacute; co tu chyb&iacute; je položka s koment&aacute;ře-mi.Hlavn&iacute; rozd&iacute;l je zde, ale v tom že zde se daj&iacute; upravit věci jako je Priorita,Typ,Status,Nadpis a Popis Issue. Tak&eacute; zde bude možn&eacute; vložit př&iacute;lohu. A změnit ře&scaron;itele.</p>\n<h3 style=\"text-align: justify;\"><strong>Odstraněn&iacute; Issue</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na červen&eacute; tlač&iacute;tko se zobraz&iacute; ok&eacute;nko, kde je uvedena ot&aacute;zka zda danou Issue chcete opravdu smazat. Pokud ji opravdu smazat kliknete je&scaron;tě jednou na červen&eacute; tlač&iacute;tko Zmazať jinak kliknete na tlač&iacute;tko Zatvoriť.</p>\n<h2><strong>&nbsp;<span style=\"text-decoration: underline;\">Project Settings</span></strong></h2>\n<h3><strong>Project Settings - Z&aacute;kladn&iacute; popis a akce</strong></h3>\n<p>Po kliknut&iacute; na z&aacute;ložku Settings se zobraz&iacute; str&aacute;nka s V&scaron;eobecn&yacute;m nastaven&iacute;m a v lev&eacute;m menu v&iacute;d&iacute;me z&aacute;ložky Projektov&eacute; nastaven&iacute;, Ostatn&iacute; nastaven&iacute; a Služby.</p>\n<h3><strong>V&scaron;eobecn&eacute; nastaven&iacute;</strong></h3>\n<p>Zde můžete vidět n&aacute;zev projektu a jeho popis, kter&yacute; je možno upravovat.</p>\n<h3><strong>Projektov&eacute; Role</strong></h3>\n<p>V tomto nastaven&iacute; je možn&eacute; vidět a nastavit jak&eacute; role patř&iacute; jak&eacute;mu uživatele v aktu&aacute;ln&iacute;m projektu. Je zde možnost přiřadit roli k Test Manager, Project Manager, Test Executor, Guest, Test Analyses, Developer a Reporter</p>\n<h3><strong>Ostatn&iacute;&nbsp; Nastaven&iacute;</strong></h3>\n<p>Zde můžete projekt buď archivovat kliknut&iacute;m&nbsp; na žlut&eacute; tlač&iacute;tko a nebo &uacute;plně smazat kliknut&iacute;m na tlač&iacute;tko červen&eacute;.</p>\n<h3><strong>Services</strong></h3>\n<p>Zde nastav&iacute;te Issue Tracker, kter&yacute; př&iacute;padně propoj&iacute; Juno např&iacute;klad s Jirou, zvol&iacute;te Issue Tracker vypln&iacute;te potřebn&eacute; kolonky a nastav&iacute;te mapov&aacute;n&iacute;.&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>Issues</strong></h2>\n<h3 style=\"text-align: justify;\"><strong>Issue- Z&aacute;kladn&iacute; popis a akce</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na z&aacute;ložku Issues se zobraz&iacute; str&aacute;nka, kde je možno vidět seznam již vytvořen&yacute;ch Issues. Je zde vidět jejich ID, n&aacute;zev Test Stepu, Sprintu a Casu pro kter&eacute; byla Issue vytvořena, n&aacute;zev Issue, popis dan&eacute; Issue, kdo m&aacute; Issue ře&scaron;it, typ Issue (jestli je to bug, defect nebo request), jej&iacute; prioritu, status a datum vytvořen&iacute; Issue.Vpravo vedle data vytvořen&iacute; jsou viděl jednotliv&eacute; akce. Je zde Zobrazit Issue, Editovat Issue a Smazat Issue. Nad těmito akcemi jsou vidět dal&scaron;&iacute; 4 tlač&iacute;tka. Když kliknete na mal&eacute; modr&eacute; tlač&iacute;tko , tak se v&aacute;m zobraz&iacute; filtr, kter&yacute; v&aacute;m usnadn&iacute; pr&aacute;ci při vyhled&aacute;v&aacute;n&iacute; konkr&eacute;tn&iacute; Issue. Pokud kliknete vedle na mal&eacute; b&iacute;le tlač&iacute;tko, zobraz&iacute; seznam věc&iacute;, kter&eacute; chcete v seznamu u Issue vidět. Tento seznam si můžete jakkoliv editovat např. v seznamu bude vidět jen n&aacute;zev Issues, jejich priorita a ře&scaron;itel.</p>\n<h3 style=\"text-align: justify;\"><strong>Založen&iacute; nov&eacute; Issue</strong></h3>\n<p style=\"text-align: justify;\">Je to možn&eacute; dvěma způsoby. 1. způsob už byl zm&iacute;něn u Test Execution. Takže zde bude pops&aacute;n ten druh&yacute;. Prvn&iacute;m krokem je kliknut&iacute; na tlač&iacute;tko Založit Issue, kde se pot&eacute; zobraz&iacute; str&aacute;nka s voln&yacute;mi kolonkami, kter&eacute; mus&iacute; b&yacute;t vyplněny.Mus&iacute;te zde zadat vybrat Test Plan, Sprint, Set, Case a Step u kter&eacute;ho chyba nastala, zvolit Prioritu, kter&aacute; může nab&yacute;vat hodnot: Low, Medium a High, Typ dan&eacute; chyby, kter&yacute; může b&yacute;t buď Bug, Defect a nebo Request. Pot&eacute; stručně napsat n&aacute;zev chyby a pod to podrobněj&scaron;&iacute; popis probl&eacute;mu. Tak&eacute; zde můžete přidat přilohu jako např. obr&aacute;zek co přesně se stalo, když nastala chyba. A vyplnit Seznam aplikac&iacute;, Prostřed&iacute;, Modul pokud je třeba. V posledn&iacute; řadě mus&iacute;te zvolit kdo by dan&yacute; probl&eacute;m měl vyře&scaron;it .&nbsp;</p>\n<h3 style=\"text-align: justify;\"><strong>Export Issues</strong></h3>\n<p style=\"text-align: justify;\">Kliknut&iacute;m na tlač&iacute;tko Export se do va&scaron;eho poč&iacute;tače st&aacute;hne soubor s př&iacute;ponou .csv. Tu když otevřete tak zde bude tabulka Issues kter&eacute; jsou i na port&aacute;le se v&scaron;emi informacemi o Issues.</p>\n<h3 style=\"text-align: justify;\"><strong>Zobrazit Issue</strong></h3>\n<p style=\"text-align: justify;\">Když kliknete na tlač&iacute;tko Zobrazit Issue,nebo na n&aacute;zev Issue zobraz&iacute; se str&aacute;nka, kde můžete vidět ve&scaron;ker&eacute; informaci o probl&eacute;mu, kter&yacute; nastal. Nemůžete tyto informace nijak upravit ale můžete k dan&eacute;mu probl&eacute;mu vložit koment&aacute;ř.</p>\n<p style=\"text-align: justify;\">Ten se vkl&aacute;d&aacute; dole na str&aacute;nce.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit vyskoč&iacute; okno, kde můžeme Upravit Issue.</p>\n<h3 style=\"text-align: justify;\"><strong>Upravit Issue</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na žlut&eacute; tlač&iacute;tko vpravo od tlač&iacute;tka Zobrazit Issue se zobraz&iacute; podobn&aacute; str&aacute;nka jako při kliknut&iacute; na tlač&iacute;tko Zobrazit Issue. Jedin&eacute; co tu chyb&iacute; je položka s koment&aacute;ře-mi.Hlavn&iacute; rozd&iacute;l je zde, ale v tom že zde se daj&iacute; upravit věci jako je Priorita,Typ,Status,Nadpis a Popis Issue. Tak&eacute; zde bude možn&eacute; vložit př&iacute;lohu. A&nbsp;změnit&nbsp;ře&scaron;itele.</p>\n<h3 style=\"text-align: justify;\"><strong>Odstraněn&iacute; Issue</strong></h3>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na červen&eacute; tlač&iacute;tko se zobraz&iacute; ok&eacute;nko, kde je uvedena ot&aacute;zka zda danou Issue chcete opravdu smazat. Pokud ji opravdu smazat kliknete je&scaron;tě jednou na červen&eacute; tlač&iacute;tko Zmazať jinak kliknete na tlač&iacute;tko Zatvoriť.</p>\n<h2 style=\"text-align: center;\"><strong>Uživatel&eacute;</strong></h2>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na z&aacute;ložku Uživatel&eacute; se otevře str&aacute;nka, kde jsou vidět v&scaron;ichni uživatel&eacute;. Je zde vidět jejich ID, Jm&eacute;no, Př&iacute;jmen&iacute;, E-mail a Datum vytvořen&iacute;.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na přidat uživatele se otevře z&aacute;ložka, kde vypln&iacute;me &uacute;daje jako jm&eacute;no, př&iacute;jmen&iacute;, heslo, email, telefon.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit se otevře z&aacute;ložka, kde můžeme změnit nějak&eacute; informace uživatele.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me smaz&aacute;n&iacute;.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Archivovat/Odarchivovat můžeme archivovat př&iacute;padně odarchivovat uživatele.</p>\n<h2 style=\"text-align: center;\"><strong>Log&nbsp;</strong></h2>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na z&aacute;ložku Log se v&aacute;m otevře str&aacute;nka, kde je možnost vidět přehled v&scaron;ech logů. Je zde vidět jejich id, popis jednotliv&yacute;ch logů, n&aacute;zev akce, kter&aacute; se provedla, uživatele, kteř&iacute; tu akci provedli, IP adresu poč&iacute;tače, kde byla akce provedena a Datum vložen&iacute;.</p>\n<h2 style=\"text-align: center;\"><strong>Nastaven&iacute;</strong>&nbsp;</h2>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na z&aacute;ložku Nastaven&iacute; se v&aacute;m objev&iacute; dvě možnosti na v&yacute;běr. Po kliknut&iacute; na V&scaron;eobecn&eacute; se otevře str&aacute;nka, kde si můžete přeč&iacute;st Jm&eacute;no, E-mail, Telefonn&iacute; Č&iacute;slo, Adresu a Fakturačn&iacute; &uacute;daje, kter&eacute; můžete změnit a žlut&yacute;m tlač&iacute;tkem Uložit.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Specifick&eacute; se otevře str&aacute;nka, kde jsou vidět dal&scaron;&iacute; z&aacute;ložky : Role, Mailer, LDAP, Seznam aplikac&iacute;, Modul, Prostřed&iacute;</p>\n<h3 style=\"text-align: justify;\"><strong>Role</strong></h3>\n<p style=\"text-align: justify;\">Zde si můžeme prohl&eacute;dnout n&aacute;zvy jednotliv&yacute;ch rol&iacute;, kter&eacute; jsou rozděleny na Projektov&eacute; role a Webov&eacute; role.&nbsp;Jednotliv&eacute; role se daj&iacute; přidat, upravit nebo odstranit.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Přidat roli vyskoč&iacute; okno, kde zad&aacute;te N&aacute;zev role a rozhodnete se, zda role bude patřit do Projektov&yacute;ch nebo Webov&yacute;ch roli.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit&nbsp;se zobraz&iacute; str&aacute;nka, kde můžeme změnit n&aacute;zev role&nbsp;a přidat nebo odebrat opr&aacute;vněn&iacute;, pot&eacute; kliknut&iacute;m na žlut&eacute; tlač&iacute;tko Upravit ulož&iacute;te změny.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na červen&eacute; tlač&iacute;tko Smazat vyskoč&iacute; okno, kde potvrd&iacute;te smaz&aacute;n&iacute;.</p>\n<h3 style=\"text-align: justify;\"><strong>Mailer</strong></h3>\n<p style=\"text-align: justify;\">&nbsp;Zde můžete nastavit aplikaci na zas&iacute;lan&iacute; emailů nastaven&iacute;m udajů SMTP.&nbsp;</p>\n<h3 style=\"text-align: justify;\"><strong>LDAP</strong></h3>\n<p style=\"text-align: justify;\">&nbsp;Zde můžete nastavit LDAP server.</p>\n<p style=\"text-align: justify;\">&nbsp;</p>\n<h3 style=\"text-align: justify;\"><strong>Seznam aplikac&iacute;</strong></h3>\n<p style=\"text-align: justify;\">Zde vid&iacute;te tabulku jednotliv&yacute;ch aplikac&iacute;, kter&eacute; jsou propojeny Moduly a Prostřed&iacute;mi.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Přidat vyskoč&iacute; okno, kde zad&aacute;me potřebn&eacute; informace.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Klonovat vyskoč&iacute; předvyplněn&eacute; okno, kde jen změn&iacute;me potřebn&eacute; informace.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit n&aacute;m vyskoč&iacute; okno, kde můžeme změnit informace o aplikaci.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me smaz&aacute;n&iacute;.</p>\n<h3 style=\"text-align: justify;\"><strong>Modul</strong></h3>\n<p style=\"text-align: justify;\">Zde vid&iacute;te tabulku jednotliv&yacute;ch modulů.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Přidat vyskoč&iacute; okno, kde zad&aacute;me potřebn&eacute; informace.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit n&aacute;m vyskoč&iacute; okno, kde můžeme změnit informace o aplikaci.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me smaz&aacute;n&iacute;.</p>\n<h3 style=\"text-align: justify;\"><strong>Prostřed&iacute;</strong></h3>\n<p style=\"text-align: justify;\">Zde vid&iacute;te tabulku jednotliv&yacute;ch prostřed&iacute;.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Přidat vyskoč&iacute; okno, kde zad&aacute;me potřebn&eacute; informace.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Upravit n&aacute;m vyskoč&iacute; okno, kde můžeme změnit informace o prostřed&iacute;.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me smaz&aacute;n&iacute;.</p>\n<h2 style=\"text-align: center;\"><strong>Syst&eacute;m&nbsp;</strong></h2>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na z&aacute;ložku Syst&eacute;m se v&aacute;m objev&iacute; dvě možnost&iacute; na v&yacute;běr.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na N&aacute;pověda si můžeme přeč&iacute;st n&aacute;povědu k&nbsp;použ&iacute;v&aacute;n&iacute; str&aacute;nky JUNO, kterou si můžeme i st&aacute;hnout.</p>\n<p style=\"text-align: justify;\">Po kliknut&iacute; na Informace si můžeme přeč&iacute;st Informace o DENEVY Slovakia s.r.o. a o Informačn&iacute;m syst&eacute;mu&nbsp;Juno</p>\n<h2 style=\"text-align: center;\"><strong>&Uacute;loži&scaron;tě</strong></h2>\n<p><strong>Popis:</strong></p>\n<p>&Uacute;loži&scaron;tě slouž&iacute; pro &uacute;schovu jednotliv&yacute;ch Test Setů/Casů a jejich n&aacute;sledn&eacute; použit&iacute;.&nbsp;V &Uacute;loži&scaron;ti budou uloženy a v pokud budou potřeba importuj&iacute; se do projektů. &Uacute;loži&scaron;tě zjednodu&scaron;uje pr&aacute;ci s Testovac&iacute;mi sc&eacute;n&aacute;ři, nemus&iacute; se ps&aacute;t znova jen se použ&iacute;j&iacute; z &uacute;loži&scaron;tě.</p>\n<p><strong>Akce:</strong></p>\n<p>Po kliknut&iacute; na Složka vyskoč&iacute; okno, kde zad&aacute;me n&aacute;zev a aplikaci po kliknut&iacute; na Vytvořit, vznikne nov&aacute; složka pro &uacute;schovu.</p>\n<p>D&aacute;le jsou zde funkce jako v test anal&yacute;ze na vytvořen&iacute; Testovac&iacute;ch sad/sc&eacute;n&aacute;řů, import..(popis je v Test Anal&yacute;ze v&yacute;&scaron;&scaron;e v n&aacute;povědě)</p>\n<p>Po kliknut&iacute; na Upravit vyskoč&iacute; okno na &Uacute;pravu složky.</p>\n<p>Po kliknut&iacute; na Smazat vyskoč&iacute; okno, kde potvrd&iacute;me smaz&aacute;n&iacute;.</p>\n<h2 style=\"text-align: center;\"><strong>Popis a pr&aacute;va jednotliv&yacute;ch rol&iacute;</strong></h2>\n<p style=\"text-align: justify;\"><img src=\"https://git.denevy.eu/ArtexeSRO/Juno/uploads/f0a576be3c29d73172c66d0aab51ca99/workflow.png\" alt=\"WorkFlow\" width=\"1072\" height=\"1419\" /></p>','2016-05-03 11:55:47'),(12,'mailer_host','admin.emaily.online','2016-08-08 13:59:18'),(13,'mailer_port','587','2016-08-08 13:59:26'),(14,'mailer_username','support@denevy.de','2016-08-08 13:59:41'),(15,'mailer_password','njrdGgH6BhPx7A4q','2016-08-08 13:59:52'),(16,'mailer_secure','tls','2016-08-08 14:00:02'),(17,'mailer_timeout','20','2016-08-08 14:00:09'),(18,'licence_key','eyJhbGciOiJSUzUxMiJ9.eyJ2YWxpZFRvIjoiMjAxOC0xMi0zMSIsImp0aSI6IjY5MDJlZDBhLTZiYTUtNDhlNS1iMDdlLTMzN2YwYjA2ZjJlNCIsImlhdCI6MTUyODgwNjY2MywiZXhwIjoxNTQ2Mjk3MjAwfQ.V6IRHwN-VHjqrVbHcDyq9JbnRqvwIa7PtxwUJie6H5NZqdjnHM5Lb_sG5aUTiMlNcLNXyYxFTQvku1lq50TmXQgWCzfKlC5-IUQnzcaRGmvYWo6Jxa-TnAWOuSMbj42NHGlnIWNzqG0If0Du6BKLXyNDIo5DvGVP-UeQgrdI2cbkxf7lyVTJh-nnj7Tufw2fMuThpw2oykxUynDAy5WjykTgDzRtPfg8I2pzP65EJb9ZhtACy71zIDh2ogKbOgidmgANEPv2djajzIIIcEb4WAocYmfPiWAE6r3COqZBJQ08_pGYYl-lUqP4C6ei39y35K3oiimKdR-eUuLBoqA3Jg','2018-05-17 07:43:09'),(19,'hostname','ldap://vpn.denevy.eu:9389','2018-06-25 08:06:42'),(20,'ldapAdminGroups','[]','2018-06-25 08:07:01'),(21,'ldapUserGroups','[]','2018-06-25 08:07:16'),(22,'ldapBaseDn',NULL,'2018-06-25 08:07:28'),(23,'ldap','1','2018-06-25 08:09:36'),(24,'admin_name','tuser@denevy.eu','2018-06-25 08:09:52'),(25,'admin_password','Heslo123+','2018-06-25 08:10:08');
